import React from "react";
import "../assets/Forecast.css";

import {
  Accordion,
  AccordionItem,
  AccordionItemButton,
  AccordionItemHeading,
  AccordionItemPanel,
} from "react-accessible-accordion";
const ForecastDay = () => {
  return (
    <>
      <label className="title">Daily</label>
      <Accordion allowZeroExpanded>
        <AccordionItem>
          <AccordionItemHeading>
            <AccordionItemButton>
              <div className="daily-item">
                <img alt="weather" className="small-icon" src="/icons/.png" />
                <label className="day">days</label>
                <label className="description">item</label>
                <label className="min-max">21c</label>
              </div>
            </AccordionItemButton>
          </AccordionItemHeading>
          <AccordionItemPanel></AccordionItemPanel>
        </AccordionItem>
      </Accordion>
    </>
  );
};

export default ForecastDay;
